import "../index.css"
import Picture from ".src/HomePage/components/Picture"
import {useEffect,useState} from "react"
function refresh(){
    alert('Hello')
}
/*
onClick後 會去後端拉資料 顯示在前端(跳頁) onChange
*/

//show image 
const PredictWeather = (event) =>{
    <Picture />
    console.log("PredictWeather")
}

const List = ({data})=>{
    // const users = [
    //     {name:"Pedro",age:21},
    //     {name:"Hope",age:23}
    // ]
    
    
    return <div className="list">
        <select name="WeatherData" onChange={PredictWeather}>
            {data && data.map((item)=>{
                return(
                    <option>
                        <div>
                            {item.Loc} DayTemp:{item.DayTemp.toFixed(2)} NightTemp:{item.DayTemp.toFixed(2)} WindSpeed:{item.WindSpeed.toFixed(2)} 
                            DayHumidity:{item.DayHumidity.toFixed(2)} NightHumidity:{item.NightHumidity.toFixed(2)}
                        </div>
                    </option>
                )
            })}
        </select>
    </div>     
}

export default List;
